out good wine right here in this bottle. Perfect for every occasion we love.\", \"Here at I heart we put our passion into creating straight-talking, great tasting wines for you to simply enjoy, whatever the occasion.\", \"Wine of Italy\", \"Elegant & bubbly\", \"Extra dry\", \"Pack size: 75cl\", \"Contains Sulphites\", \"An elegant and bubbly, fruity sparkling wine full of sweet peach and apple flavours\", \"Prosecco is made using the Charmat sparkling method, whereby the wine undergoes secondary fermentation in state of the art stainless steel tanks, to add the bubbles and make the wine \\u2018spumante\'.\", \"Here at i heart we put our passion into creating straight-talking, great-tasting wines for you to enjoy, whatever the occasion. The wines are \\u2018true to varietal\' in style- if you love Prosecco then you will love i heart Prosecco! We have done the hard work for you and pre-selected great examples of everyone\'s favourite wines. All you have to do is follow your heart and pour yourself a glass.\", \"The grapes for i heart Prosecco were grown in the renowned and beautiful Prosecco region of Veneto, located in the north of Italy close to the city of Venice. The region is protected from the harsh northern European climate by the Alps whose foothills form Veneto\'s northern extremes. These cooler climates are well suited to white wine grape varieties.\", \"This wine is ideal for drinking now but can be kept for up to 1 year\", \"Contents under pressure. Open with care in a safe direction away from face.\", \"Produced by:\", \"CA. VI. M. Srl,\", \"Ovada-AL,\", \"Italy.\", \"Copestick Murray,\", \"SN8 4AN,\", \"UK.\", \"Copestick Murray,\", \"SN8 4AN,\", \"UK.\"]','null','null','null','null','null','null','null','75cl ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/96148e90-8c59-42a8-8013-7b20e4b162c4/snapshotimagehandler_7936649.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Drinks','Wine','Champagne & Sparkling Wine','null','null','yes','null','null','null','null','8.5','null','null','null','null','null','null','null','null','null');
