 with iron to support normal cognitive development.\", \"GOS/FOS & HMO 3\'GL - Our blend of Galacto- and Fructo-oligosaccharides. HMO 3\'-Galactosyl-lactose produced by our unique process.\", \"Our Unique Expertise\", \"Nutricia has over 120 years of expertise in early life science, with a passionate team of more than 500 scientists and experts. We have been pioneering breastmilk research for 40 years taking inspiration from the benefits of nature.\", \"Our breastmilk research has enabled us to develop our next generation Aptamil\\u00ae Follow On Milk with Pronutra\\u2122-Advance. It is specifically tailored to support your baby\'s development and contains vitamin D to support the normal function of the immune system.\", \"Also available in ready to drink\", \"200ml and 1 litre bottles\", \"Pour into your regular feeding beaker\", \"Contains our unique blend of ingredients\", \"Moving to the next stage\", \"Aptamil\\u00ae Growing Up Milk 1-2 years powder\", \"Contains Pronutra\\u2122-Advance\", \"Enriched with iron to support normal cognitive development\", \"Nutritionally tailored to support your toddler\'s development\", \"We are devoted to providing you & your baby our very best.\", \"We don\'t produce for any supermarket own-label brands.\", \"Packaged in a protective atmosphere. Contents may settle in transit.\", \"Updated formulation\", \"With vitamin D to support the normal function of the immune system\", \"Tailored to complement a weaning diet\", \"Pack size: 800g\", \"With vitamin D to support the normal function of the immune system\", \"Enriched with iron to support normal cognitive development\", \"Contains: Fish, Milk, Soya\", \"Feeding Guide\", \"Approx. 1 beaker; No. of level scoops per feed (1 scoop = 4.8g): 7; Quantity of water per feed: 210ml, 7fl oz\", \"After 6 months, once weaning is established, we recommend giving your baby about 1 pint (500-600ml) per day. Aptamil\\u00ae Follow On Milk is specially formulated to help meet the increased nutritional needs of infants from 6 to 12 months. This information is given as a guide only. Consult your healthcare professional if you require more advice.\", \"Important: Always use the scoop provided, please note the colour of the scoop in this pack may change from time to time.\", \"How to use this pack\", \"To open, remove tamper evidence strip on the rim of pack.\", \"There is a handy leveller built into the pack. Store your scoop in the lid so that it is kept safe and secure.\", \"Click the lid securely shut to keep your powder fresh.\", \"Preparing your baby\'s feed\", \"Because powdered milks are not sterile, failure to follow instructions may make your baby ill.\", \"1 Wash hands and sterilise all utensils according to manufacturers\' instructions.\", \"2 Boil 1 litre of freshly run water. Leave kettle to cool for 30 minutes and no longer. Measure the required amount of water (refer to feeding guide) into a sterilised beaker. Be careful of scalding. Do not use artificially softened or repeatedly boiled water.\", \"3 Using the scoop provided, level off the powder with the built in leveller. Do not press/heap the powder.\", \"4 Add the correct measure of powder to the water. Adding too many or too few scoops can be harmful. Place the sterilised lid on the beaker and shake immediately, vertically and vigorously for at least 10 seconds, until the powder is dissolved.\", \"5 Cool under running tap. Check temperature of feed. Feed immediately.\", \"Important feeding and storage advice\", \"Make up each feed as required.\", \"For hygiene reasons, do not store made up feeds, discard unfinished feeds as soon as possible, and always within 2 hours.\", \"Do not heat feeds in a microwave, hot spots may occur and cause scalding.\", \"Never add extra scoops or anything else to your baby\'s feed.\", \"Never leave your baby alone during feeding.\", \"Important notice\", \"Breastfeeding is best for babies. Aptamil\\u00ae Follow On Milk is only for babies over 6 months, as part of a mixed diet. It should not be used as a breastmilk substitute before 6 months. The decision to start weaning including the use of this product before 6 months should be made only on the advice of a doctor, midwife, health visitor, public health nurse, dietitian, pharmacist, or other professional responsible for maternal and child care, based on baby\'s individual needs.\", \"When bottle feeding do not allow prolonged or frequent contact of milk feeds with your baby\'s teeth as this increases the risk of tooth decay. Ask your healthcare professional or dentist for advice. Make sure your baby\'s teeth are cleaned after the last feed at night.\", \"Nutricia Ltd,\", \"White Horse Business Park,\", \"Trowbridge,\", \"Wiltshire,\", \"BA14 0XQ.\", \"Nutricia Ireland Ltd,\", \"Quality guarantee\", \"This product should reach you in perfect condition. If it is not satisfactory, please contact us. This guarantee does not affect your statutory rights.\", \"Call on our expertise\", \"Our team of baby feeding advisors can offer support and advice\", \"UK 0800 996 1000 (24/7 service)\", \"www.aptaclub.co.uk\", \"Nutricia Ltd,\", \"White Horse Business Park,\", \"Trowbridge,\", \"Wiltshire,\", \"BA14 0XQ.\", \"ROI 1 800 22 12 34 (8:00-20:00 Monday-Friday)\"]','null','null','null','null','null','null','null','800g ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/5f19bc28-c3af-4c8c-87a5-d56f1187f357/snapshotimagehandler_84613253.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Baby','Baby & Toddler Milk','Follow On Baby Milk From 6 Months','null','null','yes','null','null','null','null','10.85','null','null','null','null','null','null','null','null','null');
