, \"Ready-to-use milks don\'t need any preparation. Just pour them straight into your little one\'s sterilised beaker. Available in a handy 200ml or 1 litre bottle.\", \"What\'s Next?\", \"Toddling, exploring, learning to talk - as they do more, they need more love and support. From 12 months, your baby will take on even more new challenges. So you may decide to move on to Cow & Gate growing up milk. It\'s nutritionally tailored to support 1-2 year old\'s changing needs, as part of a varied diet.\", \"Packaged in a protective atmosphere. Contents may settle in transit.\", \"Enriched with iron, vitamin D and calcium\", \"Complements a weaning diet\", \"Pack size: 800g\", \"Vitamin D & Calcium for normal bone development\", \"Iron to support normal cognitive development\", \"Contains: Milk, Soya\", \"Feeding guide 6-12 months\", \"Approx. 1 beaker/bottle, Quality of water: 210ml, 7fl.oz, No. of level scoops (1 scoop = 4.9g): 7\", \"After 6 months, once weaning is established, we recommend giving your baby about 1 pint (500-600ml) of follow-on milk per day. Cow & Gate follow-on milk is specially formulated for the nutritional needs of infants from 6 to 12 months. This information is given as a guide only.\", \"Consult your healthcare professional if you require more advice.\", \"Always use the scoop provided, please note the colour of the scoop may change from time to time.\", \"How to use this pack\", \"To open: remove tamper evidence strip and lift lid.\", \"In the pack is a scoop and leveller to help you measure the correct amount of powder. Store your scoop in the lid between uses.\", \"Click the lid securely shut to keep your powder fresh.\", \"How to prepare\", \"Because powdered milks are not sterile, failure to follow instructions may make your baby ill.\", \"1 Wash hands and sterilise all utensils according to manufacturer\'s instructions.\", \"2 Boil 1 litre of freshly run water. Leave kettle to cool for 30 minutes and no longer. Measure the required amount of water (refer to feeding guide) into a sterilised bottle/beaker. Be careful of scalding. Do not use artificially softened or repeatedly boiled water.\", \"3 Using the scoop provided, level off the powder with the built in leveller. Do not press/heap the powder.\", \"4 Add one scoop to every 30ml (1 fl.oz) of boiled cooled water. Never add extra scoops or anything else to your baby\'s feed. Cap the bottle/beaker and shake well (for 10 seconds) to dissolve powder. If using a bottle, remove cap and replace with a sterilised teat.\", \"5 Cool under running tap. Check temperature of feed. Feed immediately.\", \"For hygiene reasons, do not store made up feeds. Make up each feed as required and always discard unfinished feeds within 2 hours.\", \"If necessary, offer cooled boiled water between feeds.\", \"Do not heat in a microwave, hot spots may occur and cause scalding\", \"Important notice\", \"Cow & Gate follow-on milk is only for babies over 6 months as part of a mixed diet.\", \"It should not be used as a breastmilk substitute before 6 months. The decision to start weaning including the use of this product before 6 months should only be made on the advice of a doctor, midwife, health visitor, public health nurse, dietitian, pharmacist or other professional responsible for maternal and child care, based on baby\'s individual needs.\", \"Dental advice\", \"Do not allow prolonged or frequent contact of milk feeds with your baby\'s teeth as this increases the risk of tooth decay. Ask your healthcare professional or dentist for advice. Make sure your baby\'s teeth are cleaned after the last feed at night.\", \"Never leave your baby alone during feeding.\", \"Nutricia Ltd,\", \"White Horse Business Park,\", \"Trowbridge,\", \"Wiltshire,\", \"BA14 0XQ.\", \"Nutricia Ireland Ltd,\", \"Quality guarantee\", \"This product should reach you in perfect condition.\", \"If its is not satisfactory, please contact us. This guarantee does not affect your statutory rights.\", \"Want to know more?\", \"Got a question or just want to find out more? Give us a call. We\'ll be happy to chat to you about your little one\'s changing needs or about any of our products and services.\", \"Nutricia Ltd,\", \"White Horse Business Park,\", \"Trowbridge,\", \"Wiltshire,\", \"BA14 0XQ.\", \"UK 0800 977 4000\", \"cowandgate.co.uk\"]','null','null','null','null','null','null','null','800g ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/1058cacb-90b2-4630-94f8-44efc2777247/snapshotimagehandler_645771660.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Baby','Baby & Toddler Milk','Follow On Baby Milk From 6 Months','null','null','yes','null','null','null','null','8','null','null','null','null','null','null','null','null','null');
