 that\\u2019ll help stop leaks. \\u2022 Breathable material   helps maintain healthy bottoms. \\u2022 Dermatologically tested\", \"Fred & Flo 34 flexible easy fit pants Size 6 (16kg + / 35lbs +) Tear away Seams rip rip away  Up to 12 hours absorbent protection Breathable material Dermatologically tested\", \"When I\'m trying to lie still, My bottom just does what it will, Wriggle, jiggle, dance a bit, these easy pants are super quick! \\u2022 Up to 12 Hours absorbent protection - cosy nights all round \\u2022 Helps lock away wetness - helps keep the wee away from me. \\u2022 Tear away seams - for quick changes \\u2022 Soft and super stretchy sides \\u2022 Double layer leg cuffs - that\\u2019ll help stop leaks. \\u2022 Breathable material - helps maintain healthy bottoms. \\u2022 Dermatologically tested\", \"0, 1, 2 - newborn - cottony soft\", \"3, 4, 4+ extra absorbent, 5, 5+ extra absorbent, 6, 6+ extra absorbent - ultra dry - absorbent protection\", \"Super fit, 4/4+, 5/5+, 6/6+ - cottony soft and absorbing channels\", \"Easy fit pants - active days or cosy nights\", \"Up to 12 hours absorbent protection\", \"Breathable material\", \"Dermatologically tested\", \"Care instructions\", \"Under normal daytime use and to help ensure the comfort and health of your baby the nappy pant should be changed regularly. Ensure you have everything you need to hand before every nappy pant change. Tear away the side seams to remove your baby\'s soiled pants. Gently wipe your baby clean with a wipe or cotton wool before putting on fresh pants. Remember that keeping a dry nappy pant on your baby will keep them comfortable and help prevent nappy rash. Never leave your baby unattended on the changing table or put a mat on a raised surface to change your baby. Always dispose of your nappy pant responsibly by placing it in a nappy bag and disposing of it with normal household waste. Never flush nappies or pants down the toilet.\", \"Warning\", \"Plastic bags can be dangerous. To avoid danger of suffocation keep this bag away from babies, children & animals.\", \"Produced for:\", \"Tesco Stores Ltd.,\", \"Welwyn Garden City,\", \"AL7 1GA,\", \"U.K.\", \"Our promise\", \"We are happy to refund or replace any Tesco product which falls below the high standard you expect. Just ask any member of staff. This does not affect your statutory rights.\", \"We are here to help: Freephone 0800 50 55 55, Mon-Sat, 9am-6pm. Shop on-line at www.tesco.com\", \"Tesco Stores Ltd.,\", \"Welwyn Garden City,\", \"AL7 1GA,\", \"U.K.\"]','null','null','null','null','null','null','null','34 x Easy Fit Pants','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/2c871299-9153-4792-9b90-0b4c79e61dbd/snapshotimagehandler_1289978652.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Baby','Nappies & Pants','Size 6 & 6+ Nappies & Pants','null','null','yes','null','null','null','null','4','null','null','null','null','null','null','null','null','null');
