hook fastening. Even when I wriggle, it keeps my nappy where it should be! Fit guide shows when I\'m ready for the next size up. FOP: Dermatologically Tested BOP: Dermatologically Tested Gentle against skin\", \"0, 1, 2 - newborn - cottony soft\", \"3, 4, 4+ extra absorbent, 5, 5+ extra absorbent, 6, 6+ extra absorbent - ultra dry - absorbent protection\", \"Super fit, 4/4+, 5/5+, 6/6+ - cottony soft and absorbing channels\", \"Easy fit pants - active days or cosy nights\", \"Up to 12 hours absorbent protection, cosy nights all around\", \"Helps lock away wetness\", \"Dermatologically tested, gentle against skin\", \"Care instructions\", \"Under normal daytime use and to ensure the comfort and health of your baby the nappy should be changed regularly. Ensure you have everything to hand before every nappy change. Gently remove your baby\'s soiled nappy. Delicately wipe your baby clean with a wipe or cotton wool before putting on a fresh nappy. Remember that keeping a dry nappy on your baby will keep them comfortable and help prevent nappy rash. Never leave your baby unattended on the changing table or put a change mat on a raised surface to change your baby. Even newborns can roll off and hurt themselves. Always dispose of your nappy responsibly by placing it in a nappy bag and disposing of it with normal household waste. Never flush nappies down the toilet.\", \"Warning\", \"Plastic bags can be dangerous. To avoid danger of suffocation keep this bag away from babies, children & animals.\", \"Produced for:\", \"Tesco Stores Ltd.,\", \"Welwyn Garden City,\", \"AL7 1GA,\", \"U.K.\", \"Our promise\", \"We are happy to refund or replace any Tesco product which falls below the high standard you expect. Just ask any member of staff. This does not affect your statutory rights.\", \"We are here to help: Freephone 0800 50 55 55, Mon-Sat, 9am-6pm.\", \"Shop on-line at www.tesco.com\", \"Tesco Stores Ltd.,\", \"Welwyn Garden City,\", \"AL7 1GA,\", \"U.K.\"]','null','null','null