 do rinse thoroughly with water...\", \"Alberto Balsam Hair Care has been providing excellent affordable family shampoo to UK for generations. Over the years, we\'ve learnt to celebrate all the small things that make life beautiful. That\'s why we use delicious natural ingredients, like Raspberry, Coconut, Blueberry, strawberry and Apple in our products to give you little moments of joy with their lovely fragrances. So, your hair smells as good as it feels!\", \"Our extensive range of fresh \\u2018n\\u2019 fruity fragrances means that everyone in the family will be able to find their perfect Alberto Balsam scent, for a fantastically fragrant in-wash experience and delicious smelling hair. Perfect family shampoo.\", \"Hair smells as good as it feels!\", \"Revives and refreshes\", \"Gently cleanses\", \"With strengthening pro-vitamin B5\", \"Best for normal or greasy hair\", \"Refreshing shampoo\", \"Pack size: 350ml\", \"Caution: use only as directed. Avoid contact with eyes. If eye contact occurs wash out immediately with warm water. If irritation occurs discontinue use. As we are always looking to improve our products, our formulations change from time to time, so please always check the product packaging before use\", \"Unilever Dept ER,\", \"Wirral CH63 3JW UK\"]','null','null','null','null','null','null','null','350 ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/9d70e37f-4a2b-439b-b5e0-06bd43e75af1/snapshotimagehandler_445930601.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Health & Beauty','Haircare','Shampoo','null','null','yes','null','null','null','null','1','null','null','null','null','null','null','null','null','null');
