e with your favourate TRESemme produ\", \"Use only as directed. Avoid contact with eyes. If eye contact occurs wash out immediately with warm water. If irritation occurs discontinue use. As we are always looking to improve our products, our formulations change from time to time, so please always check the product packaging before useAVOID CONTACT WITH EYES. IN CASE OF CONTACT WITH EYES, RINSE THOROUGHLY WITH WATER..\", \"Unilever Dept ER,\", \"Wirral CH63 3JW UK\"]','null','null','null','null','null','null','null','500 ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/f08a7cd2-fa79-4015-80b2-d85058bb3119/snapshotimagehandler_438917702.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Health & Beauty','Haircare','Conditioner','null','null','yes','null','null','null','null','1.65','null','null','null','null','null','null','null','null','null');
