th whiteness\", \"Clinically proven for sensitive teeth\", \"Reaches all areas of your teeth\", \"Pack size: 75ml\", \"Directions for Use:\", \"Brush twice daily. Children of 6 years and younger: Use a pea-sized amount for supervised brushing to minimise swallowing. In case of intake of fluoride from other sources consult a dentist or doctor.\", \"Colgate-Palmolive,\", \"Guildford,\", \"GU2 8JZ.\", \"Colgate-Palmolive,\", \"Guildford,\", \"GU2 8JZ.\", \"Call free: 00-800-321-321-32\", \"www.colgate.co.uk\", \"www.colgate.eu.com\"]','null','null','null','null','null','null','null','75ml ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/a80fb058-f097-4ddd-bc28-336e61cb1f10/snapshotimagehandler_78602191.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Health & Beauty','Oral Care','Toothpaste','null','null','yes','null','null','null','null','1.5','null','null','null','null','null','null','null','null','null');
