min D to support the normal function of the immune system\", \"Contains: Fish, Milk, Soya\", \"Preparation and feeding guide\", \"After 6 months, once weaning is established, we recommend giving your baby about 1 pint (500-600ml) per day. This information is given as a guide only. Consult your healthcare professional if you require more advice.\", \"Please follow these instructions carefully. Failure to follow instructions may make your baby ill.\", \"1. Wash hands and sterilise all utensils according to manufacturers\' instructions.\", \"2. Shake bottle well. Pour the required amount of milk into a sterilised feeding beaker.\", \"3. Serve at room temperature, or warmed if desired. If warmed, check temperature of feed.\", \"Do not heat feeds in a microwave, hot spots may occur and cause scalding. Never leave your baby alone during feeding.\", \"1. For hygiene reasons, discard unfinished milk in the feeding beaker as soon as possible, and always within 2 hours.\", \"2. Any unused milk in this 200ml bottle can be stored by replacing the cap, storing upright in a refrigerator and used within 24 hours.\", \"Important notice\", \"Breastfeeding is best for babies. Aptamil\\u00ae Follow On Milk is only for babies over 6 months, as part of a mixed diet. It should not be used as a breastmilk substitute before 6 months. The decision to start weaning including the use of this product before 6 months should be made only on the advice of a doctor, midwife, health visitor, public health nurse, dietitian, pharmacist, or other professional responsible for maternal and child care, based on baby\'s individual needs.\", \"When bottle feeding do not allow prolonged or frequent contact of milk feeds with your baby\'s teeth as this increases the risk of tooth decay. Ask your healthcare professional or dentist for advice. Make sure your baby\'s teeth are cleaned after the last feed at night.\", \"Nutricia Ltd,\", \"Trowbridge,\", \"BA14 0XQ.\", \"Nutricia Ireland Ltd,\", \"Deansgrange Business Park,\", \"Deansgrange,\", \"Quality guarantee\", \"This product should reach you in perfect condition. If it is not satisfactory, please contact us. This guarantee does not affect your statutory rights.\", \"Call on our expertise\", \"Nutricia Ltd,\", \"Trowbridge,\", \"BA14 0XQ.\", \"UK 0800 996 1000 (24/7 service)\", \"www.aptaclub.co.uk\", \"Nutricia Ireland Ltd,\", \"Deansgrange Business Park,\", \"Deansgrange,\", \"Co. Dublin.\"]','null','null','null','null','null','null','null','200ml ℮','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','null','https://digitalcontent.api.tesco.com/v2/media/ghs/ca35fd8d-424f-4c7e-bbaa-d9f52297925b/snapshotimagehandler_1297923574.jpeg?h=540&w=540','null','null','null','null','null','null','null','null','null','null','null','null','null','Baby','Baby & Toddler Milk','Follow On Baby Milk From 6 Months','null','null','yes','null','null','null','null','3.2','null','null','null','null','null','null','null','null','null');
